import React from 'react';
import {Link} from 'react-router-dom'


const PleaseLog = (props) => {
    return (
        <div>
            <h3 className="text-center"> Please Log In</h3>
            <Link to={'/'} onClick={props.auth.login}> Log In </Link>       
         </div>
    );
};

export default PleaseLog;
